const user = {
  id: 118836,
  name: 'Morgrace',
  image: 'https://i.pravatar.cc/48?u=118836',
};
const Header = function () {
  return (
    <header>
      <UserAccount />
      <DiamondToken />
      <Carousel />
    </header>
  );
};
const UserAccount = function () {
  return (
    <div>
      <img src={`${user['image']}`} alt="profile picture" />
      <div>
        <span>{user['name']}</span>
        <span>{user['id']}</span>
      </div>
    </div>
  );
};
const DiamondToken = function () {
  return <div></div>;
};
const Carousel = function () {
  return <div></div>;
};
export default Header;
